export default function CurrentTemp(props){

    let EmojiSrc = `http://openweathermap.org/img/wn/${props.icon}@2x.png`;


    return(
    <div className="CurrentTemp">


        <div className="row">
            <div className="col-6">

            <img src={EmojiSrc} alt={props.desc} />{" "} 
            <span>{Math.round(props.temp)}</span>
            </div>
            <div className="col-6">

            </div>
        </div>
    </div>
    );
}
